import React from 'react'
import { Switch, Route } from 'react-router-dom'

import Main from './components/Main'

const App: React.FC = () => {
  return (
    <>
            <Switch>
                <Route exact path="/" render={(routeProps) => <Main {...routeProps} />} />
            </Switch>

        </>
  )
}

export default App;
